    public int removeDuplicates2(int[] nums) {
        if(nums == null || nums.length == 0){
            return 0;
        }
        int count = 0;
        boolean flag = false;
        for(int i=1; i<nums.length; i++){
            if(nums[count] == nums[i] && !flag){
                flag = true;
                nums[++count] = nums[i];
                continue;
            }
            if(nums[count] == nums[i] && flag){
                continue;
            } else {
                flag = false;
            	nums[++count] = nums[i];
            }
        }
        return count += 1;
    }
    
