	/**
	 * 867. 转置矩阵
	 * @param A
	 * @return
	 */
	public int[][] transpose(int[][] A) {
		if(A == null || A.length == 0) return new int[0][0];
		
		int row = A.length;
		int cloumn = A[0].length;
		int[][] rst = new int[cloumn][row];
		for(int i = 0; i < row; i++) {
			for(int j = 0; j < cloumn; j++) {
				rst[j][i] = A[i][j];
			}
		}
		return rst;
	}
	/**
	 * 334. 递增的三元子序列
	 * @param nums
	 * @return
	 */
	public boolean increasingTriplet(int[] nums) {
        int a = Integer.MAX_VALUE;
        int b = Integer.MAX_VALUE;
        
        for(int i=0; i<nums.length; i++) {
        	if(nums[i] < a)	{
        		a = nums[i];
        	} else if(nums[i] > a && nums[i] < b) {
        		b = nums[i];
        	} else if(nums[i] > b){
        		return true;
        	}
        }
        
        return false;
    }
	
	/**
	 * 238. 除自身以外数组的乘积
	 *  采用 左边乘积 × 右边乘积
	 * @param nums
	 * @return
	 */
	public int[] productExceptSelf(int[] nums) {
		int len = nums.length;
		int[] rst = new int[nums.length];
		int k = 1;
		for(int i=0; i<len; i++) {
			rst[i] = k;
			k *= nums[i];
		}
		
		k = 1;
		for(int i=len-1; i>=0; i--) {
			rst[i] *= k;
			k *= nums[i];
		}
		return rst;
	}

	/**
	 * 随机打乱数组
	 * 
	 * @author add
	 *
	 */
	class Solution {

		private int[] numsCopy;
		private int[] nums;
		private int len;

		public Solution(int[] nums) {
			this.nums = nums;
			this.numsCopy = nums.clone();
			this.len = nums.length;
		}

		/** Resets the array to its original configuration and return it. */
		public int[] reset() {
			return numsCopy;
		}

		/** Returns a random shuffling of the array. */
		public int[] shuffle() {
			for (int i = 0; i < len; i++) {
				int x = (int) (Math.random() * len);
				int y = (int) (Math.random() * len);
				swap(nums, x, y);
			}
			return nums;
		}

		private void swap(int[] nums, int x, int y) {
			int tmp = nums[x];
			nums[x] = nums[y];
			nums[y] = tmp;
		}
	}

	/**
	 * Your Solution object will be instantiated and called as such: Solution obj =
	 * new Solution(nums); int[] param_1 = obj.reset(); int[] param_2 =
	 * obj.shuffle();
	 */
	/**
	 * 存在重复元素（三）
	 * 
	 * @param nums
	 * @return
	 */
	public boolean containsNearbyAlmostDuplicate(int[] nums, int k, int t) {
		if (k <= 0)
			return false;
		Set<Integer> set = new HashSet<Integer>();
		for (int i = 0; i < nums.length; i++) {
			Iterator<Integer> iterator = set.iterator();
			if (set.isEmpty()) {
				set.add(nums[i]);
				continue;
			}
			int max = Integer.MIN_VALUE;
			while (iterator.hasNext()) {
				int tmp = nums[i] - iterator.next();
				tmp = tmp > 0 ? tmp : -tmp;
				max = Math.max(max, tmp);
			}
			if (max <= t)
				return true;
			set.add(nums[i]);
			if (set.size() > k)
				set.remove(nums[i - k]);
		}
		return false;
	}

	/**
	 * 存在重复元素（二）
	 * 
	 * @param nums
	 * @return
	 */
	public boolean containsNearbyDuplicate(int[] nums, int k) {
		Set<Integer> set = new HashSet<Integer>();
		for (int i = 0; i < nums.length; i++) {
			if (set.contains(nums[i]))
				return true;
			set.add(nums[i]);
			if (set.size() > k)
				set.remove(nums[i - k]);
		}
		return false;
	}

	/**
	 * 存在重复元素
	 * 
	 * @param nums
	 * @return
	 */
	public boolean containsDuplicate(int[] nums) {
		Set<Integer> set = new HashSet<Integer>();
		for (int i : nums) {
			set.add(i);
		}
		return nums.length > set.size() ? true : false;
	}

	/**
	 * 旋转数组
	 * 
	 * @param nums
	 * @param k
	 */
	public void rotate(int[] nums, int k) {
		int temp, previous;
		for (int i = 0; i < k; i++) {
			previous = nums[nums.length - 1];
			for (int j = 0; j < nums.length; j++) {
				temp = nums[j];
				nums[j] = previous;
				previous = temp;
			}
		}
	}

	public static void exchange(int[] arr, int i, int j) {
		arr[i] = arr[i] ^ arr[j];
		arr[j] = arr[i] ^ arr[j];
		arr[i] = arr[i] ^ arr[j];
	}

	/**
	 * 乘积最大子序列
	 * 
	 * @param nums
	 * @return
	 */
	public int maxProduct(int[] nums) {
		int max = Integer.MIN_VALUE, imax = 1, imin = 1;
		for (int i = 0; i < nums.length; i++) {
			if (nums[i] < 0) {
				int tmp = imax;
				imax = imin;
				imin = tmp;
			}
			imax = Math.max(imax * nums[i], nums[i]);
			imin = Math.min(imin * nums[i], nums[i]);

			max = Math.max(max, imax);
		}
		return max;
	}

	public int maxProduct1(int[] nums) {
		if (nums.length == 0)
			return 0;
		int rst = nums[0];
		for (int i = 0; i < nums.length; i++) {
			int help = nums[i];
			for (int j = i + 1; j < nums.length; j++) {
				if ((help * nums[j]) < 0) {
					help *= nums[j];
					continue;
				} else {
					help *= nums[j];
					if (nums[i] <= help) {
						nums[i] = help;
						// nums[i] *= nums[j];
					} else {
						break;
					}
				}

			}
			if (rst < nums[i])
				rst = nums[i];
		}
		return rst;
	}

	/**
	 * 荷兰国旗问题
	 * 
	 * @param nums
	 */
	public static void sortColors(int[] nums) {
		if (nums.length == 0) {
			return;
		}
		short red = -1, blue = (short) nums.length, index = 0;
		while (index < blue) {
			if (nums[index] == 0) {
				exchange(nums, index++, ++red);
			} else if (nums[index] == 1) {
				index++;
			} else {
				exchange(nums, index, --blue);
			}
		}
	}

